=head1 DESCRIPTION

Defines settings for a target data provider for a data migration.

=head1 ATTRIBUTES


=head2 TablePreparationMode => Str

This setting determines how DMS handles the target tables before
starting a data migration, either by leaving them untouched, dropping
and recreating them, or truncating the existing data in the target
tables.



